# @param {String} s
# @param {String} t
# @return {String}
def min_window(s, t)
  freq = Hash.new(0)
  start = 0
  window = []

  goal_counts = t.split('').each_with_object(Hash.new(0)) { |e, h| h[e] += 1 }
  desired_letter_count = goal_counts.keys.count
  formed = 0

  (0...s.size).each do |i|
    char = s[i]
    next unless goal_counts[char].positive?

    freq[char] += 1
    formed += 1 if freq[char] == goal_counts[char]

    loop do
      start_char = s[start]
      break if goal_counts[start_char].positive? && freq[start_char] <= goal_counts[start_char]

      freq[start_char] -= 1
      start += 1
    end
    next unless formed == desired_letter_count
    window = if window.empty?
      [start, i]
    else
      (i - start < window[1] - window[0]) ? [start, i] : window
    end
  end

  return '' if window.empty?

  s[window.first..window.last]
end

s = "ADOBECODEBANC"
t = "ABC"

s = ""
t = "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ"
result = min_window(s, t)
puts "result: #{result}"
